CREATE DEFINER=`ta`@`%` PROCEDURE `_backup`(IN databaseName VARCHAR(50), IN prefix VARCHAR(1), IN createBackup BOOLEAN)
    MODIFIES SQL DATA
BEGIN

                DECLARE done INT DEFAULT FALSE;
                DECLARE v_table TEXT;
                DECLARE v_table_cursor CURSOR FOR
                    (SELECT table_name
                    FROM information_schema.TABLES
                    WHERE TABLE_SCHEMA = databaseName COLLATE utf8_general_ci
                        AND TABLE_NAME NOT LIKE 'batch_%'                    -- exclude batch tables
                        AND TABLE_NAME NOT LIKE 'databasechangelog%'         -- exclude liquidbase tables
                        AND TABLE_NAME NOT LIKE 'qrtz_%'                     -- exclude job schedule tables
                        AND TABLE_NAME NOT LIKE '_\_%'                       -- exclude existing backup tables
                        AND TABLE_TYPE NOT LIKE 'VIEW');                     -- exclude views
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

                OPEN v_table_cursor;

                backup_loop: LOOP
                
                    FETCH v_table_cursor INTO v_table;
                    IF done THEN
                        LEAVE backup_loop;
                    END IF;
                    SET @v_tab = v_table;
                    
                    -- Drop any existing backup tables
                    SET @drop_stmt = CONCAT('DROP TABLE IF EXISTS ', prefix, '_', @v_tab);
                    PREPARE drop_statement FROM @drop_stmt;
                    EXECUTE drop_statement;
                    DEALLOCATE PREPARE drop_statement;
                    
                    IF (createBackup) THEN
                        -- Add new backup tables
                        SET @create_stmt = CONCAT('CREATE TABLE ', prefix, '_', @v_tab, ' AS SELECT * FROM ', @v_tab);
                        PREPARE create_statement FROM @create_stmt;
                        EXECUTE create_statement;
                        DEALLOCATE PREPARE create_statement;
                    END IF;
                    
                END LOOP backup_loop;

                CLOSE v_table_cursor;

            END ;;
DELIMITER ;
