CREATE DEFINER=`ta`@`%` PROCEDURE `_backup_restore`(
					IN databaseName VARCHAR(50),
					IN prefix VARCHAR(1)
				)
BEGIN
		
					DECLARE backup_tables TEXT;
					DECLARE backup_count INT;

					SET backup_tables = '';
					SET backup_count = 0;

					-- Run backup script if z_tables not present
					SET backup_tables = CONCAT(prefix, '_','%');
					SELECT COUNT(*) INTO backup_count FROM information_schema.tables
						WHERE table_schema = databaseName COLLATE utf8_general_ci
						AND table_name COLLATE utf8_unicode_ci LIKE backup_tables;

					IF (backup_count < 1) THEN
						CALL _backup(databaseName, prefix, TRUE);
					ELSE
						CALL _restore(databaseName, prefix);
					END IF;
				
				END ;;
