                                   WHERE column_name = 'modified_timestamp' 
                                   AND table_schema = databaseName
                                   AND table_name = v_table) THEN
                        ITERATE tables_loop;
                    END IF;
                    SET @v_tab = v_table;
                    
                    -- Delete conflicting tables (they shouldn't exist, but just in case)
                    SET @drop_stmt = CONCAT('DROP TABLE IF EXISTS delta_', prefix, '_', @v_tab);
                    PREPARE drop_statement FROM @drop_stmt;
                    EXECUTE drop_statement;
                    DEALLOCATE PREPARE drop_statement;
                    
                    -- Find deltas and create delta table for each pair of backup/working tables
                    -- Make sure that modified_timestamp for new/added rows is greater than the timestamps of all backed up rows
                    -- (i.e. be careful when duplicating rows using Ctrl+Ins)
                    SET @delta_stmt = CONCAT('CREATE TABLE delta_', prefix, '_', @v_tab, ' AS 
                        (SELECT *, ''added/modified (data in working table)'' AS delta_type FROM ', @v_tab, ' 
                        WHERE (SELECT COUNT(*) FROM ', prefix, '_', @v_tab, ') = 0 
                        OR modified_timestamp > (SELECT MAX(modified_timestamp) FROM ', prefix, '_', @v_tab, '))');
                    PREPARE delta_statement FROM @delta_stmt;
                    EXECUTE delta_statement;
                    SET @delta_stmt = CONCAT('INSERT INTO delta_', prefix, '_', @v_tab, ' 
                        (SELECT *, ''deleted (data in backup table)'' AS delta_type FROM ', prefix, '_', @v_tab, ' 
                        WHERE uuid NOT IN (SELECT uuid FROM ', @v_tab, '))');
                    PREPARE delta_statement FROM @delta_stmt;
                    EXECUTE delta_statement;
                    DEALLOCATE PREPARE delta_statement;

                END LOOP tables_loop;

                CLOSE v_table_cursor;

                -- Moves the delta_type column to the left for all delta tables
                -- Then display non-empty delta tables as resultsets
                SET done = FALSE;
                OPEN v_delta_table_cursor;
                delta_tables_loop: LOOP
                
                    FETCH v_delta_table_cursor INTO v_table;
                    IF done THEN
                        LEAVE delta_tables_loop;
                    END IF;
                    SET @v_tab = v_table;
   
                    -- Move delta_status column in front
                    SET @status_stmt = CONCAT('ALTER TABLE ', @v_tab, ' MODIFY delta_type VARCHAR(100) FIRST');
                    PREPARE status_statement FROM @status_stmt;
                    EXECUTE status_statement;
                    DEALLOCATE PREPARE status_statement;
                     
                    -- Display delta tables
                    SET @disp_stmt = CONCAT('SELECT * FROM ', @v_tab);
                    PREPARE disp_statement FROM @disp_stmt;
                    EXECUTE disp_statement;
                    DEALLOCATE PREPARE disp_statement;

                END LOOP delta_tables_loop;
                CLOSE v_delta_table_cursor;

                -- Delete delta (i.e. temporary) tables
                SET @th_stmt = CONCAT('DROP TABLE IF EXISTS delta_', prefix, '_team_hierarchy;');
                PREPARE th_statement FROM @th_stmt;
                EXECUTE th_statement;
                DEALLOCATE PREPARE th_statement;
                -- GROUP_CONCAT() returns by default a max 1024 char string, but queries may be longer
                SET SESSION GROUP_CONCAT_MAX_LEN = 50000;
                SET @clean_stmt = 
                (SELECT CONCAT('DROP TABLE ', GROUP_CONCAT(table_name), ';') AS QUERY
                    FROM INFORMATION_SCHEMA.TABLES
                    WHERE TABLE_SCHEMA = databaseName
                    AND TABLE_NAME LIKE CONCAT('delta_', prefix, '%'));
                PREPARE clean_statement FROM @clean_stmt;
                EXECUTE clean_statement;
                DEALLOCATE PREPARE clean_statement;
            END ;;
