CREATE DEFINER=`ta`@`%` PROCEDURE `_sp_team_hierarchy_repopulate`(IN companyId BIGINT)
    MODIFIES SQL DATA
BEGIN
                DECLARE teamId BIGINT;
                DECLARE lockCount BIGINT;
                DECLARE done INT DEFAULT FALSE;
                -- root level teams
                DECLARE cur1 CURSOR FOR
                    SELECT id FROM team
                    WHERE NOT EXISTS (
                        SELECT 1
                        FROM team_ee_persona
                        WHERE team_ee_persona.ee_persona_id = team.team_manager_persona_id
                        AND team_ee_persona.company_id = companyId 
                    );
                -- remaining will be ophaned or other root teams where the manager is the only member.
                DECLARE cur2 CURSOR FOR
                    SELECT id FROM team
                    WHERE NOT EXISTS (
                        SELECT 1
                        FROM team_hierarchy
                        WHERE team_hierarchy.company_id = companyId
                        AND team_hierarchy.descendant_team_id = team.id
                    )
                    AND company_id = companyId;

                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

                -- pre-acquire lock for company records
                SELECT count(*) into lockCount from team_hierarchy th WHERE th.company_id = companyId FOR UPDATE;

                DELETE FROM team_hierarchy WHERE company_id = companyId;

                OPEN cur1;
                read_loop: LOOP
                    FETCH cur1 INTO teamId;
                    IF done THEN
                        LEAVE read_loop;
                    END IF;

                    CALL _sp_team_hierarchy_populate(teamId, companyId);

                END LOOP;
                CLOSE cur1;

                SET done = FALSE;

                OPEN cur2;
                read_loop: LOOP
                    FETCH cur2 INTO teamId;
                    IF done THEN
                        LEAVE read_loop;
                    END IF;

                    CALL _sp_team_hierarchy_populate(teamId, companyId);

                END LOOP;
                CLOSE cur2;

            END ;;
